    "A field investigation of sewage sludge treatments on agricultural production areas
    at DeSoto National Wildlife Refuge",nt"tracking_summary": {ntt"total":
    10,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:41:37.469208",nt"name": "a-field-investigation-of-sewage-sludge-treatments-on-agricultural-production-areas-at-deso",nt"isopen":
    false,nt"url": null,nt"notes": "The Fish and Wildlife Service and the City
    of Omaha participated in a six year study (1985-1990) to evaluate the environmental
    impacts of sewage sludge, composted sewage sludge, and commercial fertilizer applications
    on refuge croplands and the refuge environment. Baseline chemical concentrations
    were determined for the study site soils, resident deer (livers), and pheasants
    (livers). Baseline information also was determined for the soil amendments, including
    sludge, composted sludge, and commercial fertilizer. Fourteen agricultural plots,
    comprising a total of 92.8 acres, were then treated for a period of six years with
    the different soil amendments. Six plots were treated with sludge, compost, and
    commercial fertilizer soil amendments every other year. Six plots were treated with
    sludge and compost amendments every year. Two plots received no soil treatments,
    acting as controls. Residue analyses for metals were then compared with data for
    the baseline year. Results indicate no major differences for any metal concentrations
    in any plot among the years tested (baseline (1985, 1987, 1989-90). Differences
    were found in soil fertility among the test plots. However, these differences were
    not reflected in the crop yields. Very few conclusions may be drawn from the crop
    yield data. It is likely that factors external to the controlled parameters were
    affecting productivity, most likely climatic.",nt"license_title": "License
